void SwapBytes(unsigned char* x, unsigned char* y) {
	unsigned char t = *x;
	*x = *y;
	*y = t;
}

void rc4(uint8_t* const bufin, int inlen, const uint8_t* const key, int keyLen)
{
	uint8_t xorkey[0x100];
	uint8_t keyptr;
	uint8_t incremental;
	int     i;


	for (i = 0; i < 256; i++)
	{
		xorkey[i] = i;
	}

	incremental = 0;
	keyptr = 0;

	for (i = 0; i < 256; i++)
	{
		uint8_t dl;
		dl = xorkey[i];
		incremental += (key[keyptr] + xorkey[i]);
		xorkey[i] = xorkey[incremental];
		xorkey[incremental] = dl;
		keyptr = (keyptr + 1) % keyLen;
	}

	incremental = 0;

	for (i = 0; i < inlen; i++)
	{
		const uint8_t idx = (uint8_t)(i + 1);

		incremental += xorkey[idx];

		SwapBytes(xorkey + incremental, xorkey + idx);

		bufin[i] ^= xorkey[(uint8_t)(xorkey[incremental] + xorkey[idx])];
	}
}

